(1, 'C—Ç–∞—Ç—É—Ç', NULL, '<p>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É —Å—Ç–∞—Ç—É—Ç—É –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"/storage/upload/611/611cdbee4c37e959451650.pdf.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p><br></p>', NULL, '2022-05-12 20:25:58', '2022-12-16 03:55:17', 2, '', 'Published', 999),
(2, '–í–ê–ö–ê–ù–°–Ü–á', NULL, '<p><strong>–í–∞–∫–∞–Ω—Å—ñ—è –Ω–∞ –∑–∞–º—ñ—â–µ–Ω–Ω—è –ø–æ—Å–∞–¥–∏ –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞ –®–∞—Ü—å–∫–æ–≥–æ –ª—ñ—Å–æ–≤–æ–≥–æ —Ñ–∞—Ö–æ–≤–æ–≥–æ –∫–æ–ª–µ–¥–∂—É —ñ–º. –í. –í. –°—É–ª—å–∫–∞</strong></p><p><strong>–í–∏–±–æ—Ä–∏ –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞&nbsp;</strong></p><p><br></p><p><strong>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É –Ω–∞–∫–∞–∑—É –í–æ–ª–∏–Ω—Å—å–∫–æ —É–ø—Ä–∞–≤–ª—ñ–Ω–Ω—è –æ—Å–≤—ñ—Ç–∏ —ñ –Ω–∞—É–∫–∏ –ø—Ä–æ –æ–≥–æ–ª–æ—à–µ–Ω–Ω—è –∫–æ–Ω–∫—É—Ä—Å—É –Ω–∞ –∑–∞–º—ñ—â–µ–Ω–Ω—è –≤–∞–∫–∞–Ω—Ç–Ω–æ—ó –ø–æ—Å–∞–¥–∏ –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞ –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"http://stage.shlk.org.ua/storage/upload/img/IMG_20221214_0001.pdf.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><strong>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É –Ω–∞–∫–∞–∑—É –ø—Ä–æ –≤–∏–±–æ—Ä–∏ –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/nak/nakazshlk.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><strong>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É –ø–æ–ª–æ–∂–µ–Ω—å –ø—Ä–æ –≤–∏–±–æ—Ä–∏ –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞ –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/vyb/vybory.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><strong>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É –ü–µ—Ä–µ–¥–≤–∏–±–æ—Ä—á–æ—ó –ø—Ä–æ–≥—Ä–∞–º–∏ –∫–∞–Ω–¥–∏–¥–∞—Ç–∞ –Ω–∞ –ø–æ—Å–∞–¥—É –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pro/programa.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><strong>–î–ª—è –ø–µ—Ä–µ–≥–ª—è–¥—É —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ–≤ –≤–∏–±–æ—Ä—ñ–≤ –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞ –ø–µ—Ä–µ–π–¥—ñ—Ç—å –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pro/protokol.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><br></p>', NULL, '2022-05-12 20:25:58', '2022-12-21 19:07:20', 2, '1671140915_images.png', 'Published', 1000),
(6, '–ó–í–Ü–¢ –î–ò–†–ï–ö–¢–û–†–ê', NULL, '<p><em>ÔªøÔªø</em>–ó–≤—ñ—Ç –¥–∏—Ä–µ–∫—Ç–æ—Ä–∞ –∑–∞ 2022 &lt;a href=\" https://shlk.org.ua/storage/upload/zdr/zdr.pdf\"&gt; &gt; –∑–∞ –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p>', NULL, '2022-12-14 21:23:24', '2023-03-01 19:07:39', 2, '1671031404_.jpg', 'Published', 500),
(9, '–§–Ü–ù–ê–ù–°–û–í–ê –ó–í–Ü–¢–ù–Ü–°–¢–¨', NULL, '<p><strong>–†—ñ—á–Ω–∏–π –∑–≤—ñ—Ç –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ –∫–æ–ª–µ–¥–∂—É –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/zvi/zvit.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong>–ö–æ—à—Ç–æ—Ä–∏—Å –∫–æ–ª–µ–¥–∂—É —Ç–∞ –≤—Å—ñ –∑–º—ñ–Ω–∏ –¥–æ –Ω—å–æ–≥–æ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/koc/kocht.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong>–ë—é–¥–∂–µ—Ç –∫–æ–ª–µ–¥–∂—É –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/bd./bd.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong style=\"background-color: rgba(127, 221, 233, 0.6); color: rgb(103, 103, 103);\">–§—ñ–Ω–∞–Ω—Å–æ–≤–∏–π –∑–≤—ñ—Ç –ø—Ä–æ –Ω–∞–¥—Ö–æ–¥–∂–µ–Ω–Ω—è —Ç–∞ –≤–∏–∫–æ—Ä–∏—Å—Ç–∞–Ω–Ω—è –≤—Å—ñ—Ö –æ—Ç—Ä–∏–º–∞–Ω–∏—Ö –∫–æ—à—Ç—ñ–≤ </strong><strong> –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/kfz/kfz.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong>–®—Ç–∞—Ç–Ω–∏–π —Ä–æ–∑–ø–∏—Å –∫–æ–ª–µ–¥–∂—É –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/str/str.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong>–†–æ–∑–º—ñ—Ä –ø–ª–∞—Ç–∏ –∑–∞ –Ω–∞–≤—á–∞–Ω–Ω—è, –ø—ñ–¥–≥–æ—Ç–æ–≤–∫—É, –ø–µ—Ä–µ–ø—ñ–¥–≥–æ—Ç–æ–≤–∫—É, –ø—ñ–¥–≤–∏—â–µ–Ω–Ω—è –∫–≤–∞–ª—ñ—Ñ—ñ–∫–∞—Ü—ñ—ó –∑–¥–æ–±—É–≤–∞—á—ñ–≤ –æ—Å–≤—ñ—Ç–∏ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><strong>–ü–µ—Ä–µ–ª—ñ–∫ –¥–æ–¥–∞—Ç–∫–æ–≤–∏—Ö –æ—Å–≤—ñ—Ç–Ω—ñ—Ö —Ç–∞ —ñ–Ω—à–∏—Ö –ø–æ—Å–ª—É–≥, —ó—Ö –≤–∞—Ä—Ç—ñ—Å—Ç—å, –ø–æ—Ä—è–¥–æ–∫ –Ω–∞–¥–∞–Ω–Ω—è —Ç–∞ –æ–ø–ª–∞—Ç–∏ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</strong></p><p><br></p><p><strong>–Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è –ø—Ä–æ –ø–µ—Ä–µ–ª—ñ–∫ —Ç–æ–≤–∞—Ä—ñ–≤, —Ä–æ–±—ñ—Ç —ñ –ø–æ—Å–ª—É–≥, –æ—Ç—Ä–∏–º–∞–Ω–∏—Ö —è–∫ –±–ª–∞–≥–æ–¥—ñ–π–Ω–∞ –¥–æ–ø–æ–º–æ–≥–∞, –∞ —Ç–∞–∫–æ–