(11, '–ü–û–õ–û–ñ–ï–ù–ù–Ø –®–õ–§–ö', NULL, '<p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –ø–µ–¥–∞–≥–æ–≥—ñ—á–Ω—É —Ä–∞–¥—É –∫–æ–ª–µ–¥–∂—É –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/ped/pedrada.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –æ—Ä–≥–∞–Ω—ñ–∑–∞—Ü—ñ—é –æ—Å–≤—ñ—Ç–Ω—å–æ–≥–æ –ø—Ä–æ—Ü–µ—Å—É –≤ –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/osv/osv.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ –æ—Ä–≥–∞–Ω—ñ–∑–∞—Ü—ñ—é –≤–∏—Ö–æ–≤–Ω–æ—ó —Ä–æ–±–æ—Ç–∏ —É –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/vr./vr.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ –∫–ª–∞—Å–Ω–æ–≥–æ –∫–µ—Ä—ñ–≤–Ω–∏–∫–∞ –∞–∫–∞–¥–µ–º—ñ—á–Ω–æ—ó –≥—Ä—É–ø–∏ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/krg/krgr.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ —Ü–∏–∫–ª–æ–≤—É –∫–æ–º—ñ—Å—ñ—é –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –Ω–∞–≤—á–∞–ª—å–Ω—É —á–∞—Å—Ç–∏–Ω—É –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/nch/nch.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥–¥—ñ–ª–µ–Ω–Ω—è –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ –±—ñ–±–ª—ñ–æ—Ç–µ–∫—É –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pid/pidr.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø —â–æ–¥–æ –ø—Ä–æ—Ç–∏–¥—ñ—ó –±—É–ª—ñ–Ω–≥—É (—Ü—å–∫—É–≤–∞–Ω–Ω—é) —É –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –Ω–∞–≤—á–∞–ª—å–Ω–∏–π –∫–∞–±—ñ–Ω–µ—Ç (–ª–∞–±–æ—Ä–∞—Ç–æ—Ä—ñ—é) –®–õ–§–ö –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk