(12, '–ü–û–õ–û–ñ–ï–ù–ù–Ø', NULL, '<p>–ü—Ä–∞–≤–∏–ª–∞ –ø–æ–≤–µ–¥—ñ–Ω–∫–∏ –∑–¥–æ–±—É–≤–∞—á–∞ –æ—Å–≤—ñ—Ç–∏ –≤ –∫–æ–ª–µ–¥–∂—ñ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pv./pv.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ –ø–æ—Ä—è–¥–æ–∫ –ø–µ—Ä–µ–≤–µ–¥–µ–Ω–Ω—è, –≤—ñ–¥—Ä–∞—Ö—É–≤–∞–Ω–Ω—è —Ç–∞ –ø–æ–Ω–æ–≤–ª–µ–Ω–Ω—è –∑–¥–æ–±—É–≤–∞—á—ñ–≤ –æ—Å–≤—ñ—Ç–∏ —É –®–∞—Ü—å–∫–æ–º—É –ª—ñ—Å–æ–≤–æ–º—É —Ñ–∞—Ö–æ–≤–æ–º—É –∫–æ–ª–µ–¥–∂—ñ —ñ–º. –í. –í. –°—É–ª—å–∫–∞ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pp./pp.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ —Å—Ç—É–¥–µ–Ω—Ç—Å—å–∫–µ —Å–∞–º–æ–≤—Ä—è–¥—É–≤–∞–Ω–Ω—è –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/smr/smr.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ü–†–û –Ü–ù–î–ò–í–Ü–î–£–ê–õ–¨–ù–ò–ô –ù–ê–í–ß–ê–õ–¨–ù–ò–ô –ü–õ–ê–ù –ó–î–û–ë–£–í–ê–ß–ê –û–°–í–Ü–¢–ò –£ –®–∞—Ü—å–∫–æ–º—É –ª—ñ—Å–æ–≤–æ–º—É —Ñ–∞—Ö–æ–≤–æ–º—É –∫–æ–ª–µ–¥–∂—ñ —ñ–º. –í. –í. –°—É–ª—å–∫–∞ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/inp/inpl.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ —Å—Ç—É–¥–µ–Ω—Ç—Å—å–∫–∏–π –≥—É—Ä—Ç–æ–∂–∏—Ç–æ–∫ –®–∞—Ü—å–∫–æ–≥–æ –ª—ñ—Å–æ–≤–æ–≥–æ —Ñ–∞—Ö–æ–≤–æ–≥–æ –∫–æ–ª–µ–¥–∂—É —ñ–º. –í. –í. –°—É–ª—å–∫–∞ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/gur/gurt.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –≥—É—Ä—Ç–æ–∂–∏—Ç–∫–∏, –≤—ñ–ª—å–Ω—ñ –º—ñ—Å—Ü—è, —Ä–æ–∑–º—ñ—Ä –ø–ª–∞—Ç–∏ –∑–∞ –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–†–æ–∑–º—ñ—Ä –ø–ª–∞—Ç–∏ –∑–∞ –Ω–∞–≤—á–∞–Ω–Ω—è, –ø—ñ–¥–≥–æ—Ç–æ–≤–∫—É, –ø–µ—Ä–µ–ø—ñ–¥–≥–æ—Ç–æ–≤–∫—É, –ø—ñ–¥–≤–∏—â–µ–Ω–Ω—è –∫–≤–∞–ª—ñ—Ñ—ñ–∫–∞—Ü—ñ—ó –∑–¥–æ–±—É–≤–∞—á—ñ–≤ –æ—Å–≤—ñ—Ç–∏ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–µ—Ä–µ–ª—ñ–∫ –¥–æ–¥–∞—Ç–∫–æ–≤–∏—Ö –æ—Å–≤—ñ—Ç–Ω—ñ—Ö —Ç–∞ —ñ–Ω—à–∏—Ö –ø–æ—Å–ª—É–≥, —ó—Ö –≤–∞—Ä—Ç—ñ—Å—Ç—å, –ø–æ—Ä—è–¥–æ–∫ –Ω–∞–¥–∞–Ω–Ω—è —Ç–∞ –æ–ø–ª–∞—Ç–∏ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://r-before/\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–û–õ–û–ñ–ï–ù–ù–Ø –ø—Ä–æ –æ–≥–ª—è–¥-–∫–æ–Ω–∫—É—Ä—Å –Ω–∞ –∫—Ä–∞—â—É —Å—Ç—É–¥–µ–Ω—Ç—Å—å–∫—É –∫—ñ–º–Ω–∞—Ç—É –≥—É—Ä—Ç–æ–∂–∏—Ç–∫—É –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/kk./kk.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;&nbsp;</p><p>–ü–ª–∞–Ω –∑–∞—Ö–æ–¥—ñ–≤ —Å–ø—Ä—è–º–æ–≤–∞–Ω–∏—Ö –Ω–∞ –∑–∞–ø–æ–±—ñ–≥–∞–Ω–Ω—è —Ç–∞ –ø—Ä–æ—Ç–∏–¥—ñ—é –±—É–ª—ñ–Ω–≥—É (—Ü—å–∫—É–≤–∞–Ω–Ω—é) –≤ –∫–æ–ª–µ–¥–∂—ñ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/bul/bul.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ—Ä—è–¥–æ–∫ –ø–æ–¥–∞–Ω–Ω—è —Ç–∞ —Ä–æ–∑–≥–ª—è–¥—É (–∑ –¥–æ—Ç—Ä–∏–º–∞–Ω–Ω—è–º –∫–æ–Ω—Ñ—ñ–¥–µ–Ω—Ü—ñ–π–Ω–æ—Å—Ç—ñ) –∑–∞—è–≤ –ø—Ä–æ –≤–∏–ø–∞–¥–∫–∏ –±—É–ª—ñ–Ω–≥—É (—Ü—å–∫—É–≤–∞–Ω–Ω—é) –≤ –∫–æ–ª–µ–¥–∂—ñ –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/bul/bul.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p>–ü–æ—Ä—è–¥–æ–∫ —Ä–µ–∞–≥—É–≤–∞–Ω–Ω—è –Ω–∞ –¥–æ–≤–µ–¥–µ–Ω—ñ –≤–∏–ø–∞–¥–∫–∏ –±—É–ª—ñ–Ω–≥—É (—Ü—å–∫—É–≤–∞–Ω–Ω—è) –≤ –∫–æ–ª–µ–¥–∂—ñ —Ç–∞ –≤—ñ–¥–ø–æ–≤—ñ–¥–∞–ª—å–Ω—ñ—Å—Ç—å –æ—Å—ñ–±, –ø—Ä–∏—á–µ—Ç–Ω–∏—Ö –¥–æ –±—É–ª—ñ–Ω–≥—É (—Ü—å–∫—É–≤–∞–Ω–Ω—é) –¥–æ—Å—Ç—É–ø–Ω–æ –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/bul/bul.pdf\"&gt; &gt;–ø–æ—Å–∏–ª–∞–Ω–Ω—è–º&lt; &lt;/a&gt;</p><p><br></p><p><br></p><p><br></p>', NULL, '2022-12-16 20:39:13', '2023-02-09 19:56:15', 2, '', 'Published', 800),
