(16, '–í–°–¢–£–ü 2023', 'Admission rules', '<p>–®–ï–†–ò–ù–ì –ö–û–ü–Ü–á –î–û–ö–£–ú–ï–ù–¢–Ü–í (–ø–∞—Å–ø–æ—Ä—Ç —Ç–∞ –∫–æ–¥) –≤—ñ–¥—Å–∫–∞–Ω—É–π—Ç–µ –≤ –¥–æ–¥–∞—Ç–∫—É –î–Ü–Ø –¥–∞–Ω–∏–π qr –∫–æ–¥ —Ç–∞ –ø—ñ–¥—Ç–≤–µ—Ä–¥—ñ—Ç—å –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è –∫–æ–ø—ñ–π –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤!</p><p> &lt;img src=\"https://shlk.org.ua/storage/42/dia.jpeg\" height=\"700\"&gt;</p><h1><br></h1><h1><strong>–†–ï–ô–¢–ò–ù–ì–û–í–Ü –°–ü–ò–°–ö–ò &lt;a href=\"https://shlk.org.ua/storage/upload/rej/rejtung2023.pdf\"&gt; –ë–û,–õ–ì,–ú–ì &lt;/a&gt; </strong></h1><h1><strong>–°–ü–ò–°–ö–ò –†–ï–ö–û–ú–ï–ù–î–û–í–ê–ù–ò–• &lt;a href=\"https://shlk.org.ua/storage/upload/rek/rekomend2023.pdf\"&gt; –ë–û,–õ–ì,–ú–ì &lt;/a&gt; </strong></h1><p>–ü–†–ê–í–ò–õ–ê –ü–†–ò–ô–û–ú–£ 2023 –∑–∞ &lt;a href=\"https://shlk.org.ua/storage/upload/pp2/pp2023.pdf\"&gt; –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º &lt;/a&gt;  </p><p>–ë—Ä–æ—à—É—Ä–∫–∞ 2023 –∑–∞   &lt;a href=\"https://shlk.org.ua/storage/upload/b23/b23.pdf\"&gt; –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º &lt;/a&gt;  </p><p><a href=\"https://youtu.be/U7LeUbnVa9E\" target=\"_blank\" style=\"color: rgb(0, 86, 179);\">–í—ñ–¥–µ–æ—ñ–Ω—Å—Ç—Ä—É–∫—Ü—ñ—è –∑ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ–≥–æ –∫–∞–±—ñ–Ω–µ—Ç—É –≤—Å—Ç—É–ø–Ω–∏–∫–∞ —Ç–∞ –ø–æ–¥–∞–Ω–Ω—è –∑–∞—è–≤ –≤ –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ñ–π —Ñ–æ—Ä–º—ñ (–ë–°–û, 9 –∫–ª–∞—Å—ñ–≤)</a></p><p><a href=\"https://vstup.edbo.gov.ua/\" target=\"_blank\" style=\"color: rgb(0, 86, 179);\">–ï–õ–ï–ö–¢–†–û–ù–ù–ò–ô –ö–ê–ë–Ü–ù–ï–¢ –í–°–¢–£–ü–ù–ò–ö–ê  2023</a></p><p>  &lt;a href=\"https://vstup.edbo.gov.ua/offers/\"&gt; &gt;–ö–û–ù–ö–£–†–°–ù–Ü –ü–†–û–ü–û–ó–ò–¶–Ü–á –ù–ê –í–°–¢–£–ü –î–û –ö–û–õ–ï–î–ñ–£&lt; &lt;/a&gt;  </p><p>–°–∏—Å—Ç–µ–º–∞ –ö–û–ù–ö–£–†–° –∑–∞ &lt;a href=\"https://vstup.osvita.ua/r4/857/\"&gt; –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º &lt;/a&gt; </p><p>–†–µ–∑—É–ª—å—Ç–∞—Ç–∏ –≤—Å—Ç—É–ø–Ω–∏—Ö  –≤–∏–ø—Ä–æ–±—É–≤–∞–Ω—å –∑–∞ –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º  &lt;a href=\"https://shlk.org.ua/storage/upload/bo2/bo2023.pdf\"&gt; &gt;–ë–û-17.07&lt; &lt;/a&gt; —Ç–∞ &lt;a href=\"https://shlk.org.ua/storage/uplopro/prog11.pdf\